import axios from 'axios';

const API_URL = 'http://localhost:5000/auth';

const signup = (data) => {
    return axios.post(`${API_URL}/signup`, data);
};

const login = (data) => {
    return axios.post(`${API_URL}/login`, data);
};

export default {
    signup,
    login,
};
